import React from "react";
import "./modalDishBox.css";

const ModalDishBox: React.FC = ()=>{
    return(
        <div className="modal-background">
            <div className="modal-dish-box-container">
                <h1>hello!!</h1>
                <span>it's me!</span>
            </div>
        </div>
    )
} 

export default ModalDishBox;
